import React, {ReactDOM} from 'react';

const Card = (props) => {


    return (
        <div>
            <p onClick={props.click}>I'm {props.name} and I am {props.age} years old.</p>
            <p>{props.children}</p>
            {/* children refers to any element between opening and closing tag  */}
        </div>
    )
}



export default Card
